import React, { Component } from 'react';
import Items from './items.js'

class List extends Component {

    render() {
      let array = this.props.todos;
      console.log(array);
      return (
        <div className="List">
        <Items todos={array}></Items>
        </div>
      );
    }
  }

  export default List;
